ackie Brown is the name of a flight attendant who gets caught smuggling her boss' gun money on the airline she works for. Luckily for her, the Fed Ray Nicolet and the LA Cop Mark Dargus decide to team up in order to arrest the arms dealer she works for, whose name they don't even know. Here's when she has to choose one way: tell Nicolet and Dargus about Ordell Robbie (the arms dealer) and get her freedom -except that if Ordell suspects you're talking about him, you're dead- or keep her mouth shut and do some time. That's when she meets Max Cherry -her bail bondsman-, a late fifties, recently separated, burnt-out man, who falls in love with her. Then Jackie comes up with a plan to play the Feds off against Ordell and the guys he works with -Louis Gara and Melanie Ralston, among others- and walk off with their money. But she needs Max's help. No one is going to stand in the way of his million dollar payoff..



